  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains CTD cast and zooplankton
  data collected during twenty-six cruises to Dabob Bay, Washington in 2002 - 2004
  for the project entitled \"Copepod - diatom interactions in the sea: paradigm or
  paradox?\", which the National Science Foundation funded under award number OCE-0118044.
